        ('feature_columns', None),
        ('model', None),
    )

    def __init__(self):
        self.model = self.params.model
        self.feature_columns = self.params.feature_columns

    def next(self):
        if len(self.data) < len(self.feature_columns):
            logging.error("Insufficient data to generate features.")
            return

        features = []
        for col in self.feature_columns:
            if col in dir(self.data):
                feature_value = getattr(self.data, col)[0]
                features.append(feature_value)
            else:
                logging.error(f"Feature {col} not found in data.")

        # Convert to numpy array
        feature_array = np.array([features])

        # Check if feature array is empty
        if feature_array.shape[1] == 0:
            logging.error("Feature array is empty. Skipping prediction.")
            return

        logging.debug(f"Feature array: {feature_array}")

        # Make prediction
        try:
            prediction = self.model.predict(feature_array)[0]
            logging.debug(f"Prediction: {prediction}")

            # Trading logic based on prediction
            if prediction > self.data.close[0]:
                self.buy()
            elif prediction < self.data.close[0]:
                self.sell()
        except Exception as e:
            logging.error(f"Error making prediction: {e}")

